import * as React from 'react';
import Box from '@mui/material/Box';
import TextField from '@mui/material/TextField';
import { Paper } from '@mui/material';
import { Container, margin } from '@mui/system';
export default function Student() {
const paperStyle={padding:'50PX 20PX',width:600,margin:'20px auto'}  
  return (
    <Container
      
      component="form"
      sx={{
        '& .MuiTextField-root': { m: '20px auto',padding:'50PX 20PX',width:600 },
      }}
      noValidate
      autoComplete="off"
    >
      <div>
        <TextField
          required
          id="outlined-required"
          label="Required"
          defaultValue="name"
          fullWidth
        />
         <TextField
          required
          id="outlined-required"
          label="Required"
          defaultValue="age"
          fullWidth
        />
         <TextField
          required
          id="outlined-required"
          label="Required"
          defaultValue="adress"
          fullWidth
        />
        </div>
       
        </Container>

  )}
